REPLACE  IGNORE INTO `espetaculo` (`id`, `capacidade`, `data_espetaculo`, `descricao`, `destaque`, `faixa_etaria`, `imagem_casa`, `nome`, `valor`, `casa_id`, `quantidade_ingressos`) VALUES (7,192,'2020-07-01','Carreira\r\nMetheny começou a tocar guitarra aos 13 anos de idade e o seu talento desenvolveu rapidamente, ainda na adolescência ele deu aulas de música nas Universidades de Miami e Berklee.\r\n\r\nLançou seu primeiro disco em 1974 em parceria com Paul Bley e Jaco Pastorius, passando os três próximos anos na banda Gary Burton, onde conheceu o tecladista Lyle Mays e formou o seu próprio grupo em 1978 ao lado do baixista Mark Egan e do baterista Dan Gottlieb.\r\n\r\nPor algum tempo foi um dos mais populares jazzmen, chegando a fazer shows em estádios lotados, apesar disso Pat Metheny evitava tocar música comum, sempre optando por participar de projetos interessantes como o quinteto post-bop que formou com Dewey Redman e Mike Brecker ou quando se junto com Charlie Haden e Billy Higgins para o projeto “Song X” com Ornette Coleman.\r\n\r\nO guitarrista permanece em atividade lançando discos até o dia de hoje e segue como um dos grandes e mais criativos músicos de todos os tempos.\r\n\r\nFonte: Spotify e Wikipedia Pat Metheny',0,'',,'Pat Metheny',300.00,5,0),(8,200,'2020-08-01','Mesmo sendo um dos precursores e maiores nomes do thrash metal mundial, a banda nunca se prendeu ao gênero, ultrapassando barreiras e inovando no gênero tanto na sonoridade como mercadolicamente, sendo a primeira banda de thrash/speed metal a ter uma balada com acústicas com “Fade To Black” em 1985, chamando atenção do metal mainstream para o grupo ainda em ascensão, com o disco “Metallica”, também conhecido como “Black Album”, a banda revolucionou o estilo mesclando a sua pesada sonoridade com elementos do hard rock e do rock clássico, se tornando um marco da época e até hoje um dos discos mais vendidos da história, influenciando diversos outros artistas e grupos que surgiriam no rock e metal!\r\n\r\nA banda lançou dez álbuns de estúdio, quatro discos ao vivo, 37 singles, 39 videoclipes e um longa-metragem lançado em 2013 nos cinemas chamado “Through The Never”. Ganhou 9 Grammy Awards e foi indicada 23 vezes, os últimos seis álbuns lançados estrearam em primeiro lugar na Billboard 200, é uma das bandas de maior sucesso comercial da história, tendo vendido mais de 125 milhões de discos por todo o mundo e são o o terceiro artista que mais vendeu desde que a Nielsen Soundscan começou a catalogar em 1991, com 58 milhões de vendas nos Estados Unidos.\r\n\r\nEm 2009 a banda foi introduzida no Hall Da Fama do Rock And Roll.\r\n\r\nEm 2013 o Metallica fez história ao se apresentar em um show na Antártica e se tornou a primeira banda ao se apresentar em menos de um ano nos sete continentes, entrando com essa marca no Guiness Book Of World Records, o livro dos recordes mundiais.\r\n\r\nFonte: Páginas do Metallica Facebook, Spotify e Wikipedia',0,'',,'METALLICA WORLDWIRED TOUR',400.00,5,0),(9,495,'2020-09-01','Artista Global e líder de paradas, parte do casting da Interscope/Darkroom Records a artista Billie Eilish anuncia a WHERE DO WE GO? WORLD TOUR, sua turnê mundial para arenas em 2020, produzida pela Live Nation. Iniciando em 8 de março em Miami, Flórida, a WHERE DO WE GO? WORLD TOUR levará sua experiência ao vivo para algumas das mais importantes arenas do mundo, incluindo o Madison Square Garden, em Nova York, em 15 de março. As vendas para todas as cidades começam em 04 de outubro. Para a lista completa de cidades da turnê e informações de venda, veja abaixo. Para informações adicionais, clique em: www.billieeilish.com/tour\r\n\r\nOs shows no Brasil irão acontecer em São Paulo, dia 30 de maio de 2020, no Allianz Parque; e no Rio de Janeiro, dia 31 de maio de 2020, na Jeunesse Arena. A venda para o público geral começa no dia 04 de outubro, às 10h pela internet e às 12h nas bilheterias oficiais. Os ingressos, que podem ser parcelados em até 3 vezes, estarão disponíveis online (www.eventim.com.br/billieeilish) e nas bilheterias oficiais (em São Paulo, no Allianz Parque; e no Rio de Janeiro, na Jeunesse Arena). A turnê no Brasil é produzida pela Live Nation. Para mais informações, clique em www.livenation.lat.\r\n\r\nSeguindo o lançamento de seu videoclipe de ‘all the good girls go to hell’ – que traz um importante apelo em relação às mudanças climáticas – Billie Eilish segue fazendo sua parte, em parceria com a organização sem fins lucrativos REVERB, em sua próxima turnê. Para ajudar a criar e encorajar um ambiente ecologicamente consciente para o backstage e seus fãs, Billie Eilish autorizará que os fãs tragam suas garrafas refis de água aos shows e estações de água estarão disponíveis para atender ao público e equipe de produção. Canudos de plásticos não serão permitidos e uma Eco-vila Billie Eilish será criada em todos os shows, dando informações e recursos aos consumidores sobre maneiras de combater a mudança climática e preservar o Planeta Terra.',0,'',,'Billie Eilish',200.00,5,0),(10,300,'2020-10-01','Em 1983, Samuel Rosa e Henrique Portugal começaram a tocar em uma banda de reggae chamada Pouso Alto do Reggae, junto com os irmãos Dinho (bateria) e Alexandre Mourão (baixo). Em 1991, o Pouso Alto conseguiu um show na casa de concertos AeroAnta, em São Paulo, mas como os irmãos Mourão não estavam em Belo Horizonte, o baixista Lelo Zaneti e o baterista Haroldo Ferretti foram chamados para o show.Antes da apresentação, o grupo mudou seu nome para Skank, inspirado na música de Bob Marley, \"Easy Skanking\" (\"skunk\" é o nome de uma variação da cannabis sativa, popularmente conhecida como maconha). A banda fez sua estreia em 5 de junho de 1991, e devido à final do Campeonato Brasileiro no mesmo dia, o público pagante foi de 37 pessoas. Entre os presentes, estavam Charles Gavin e André Jung, ex-bateristas dos Titãs e do Ira!, respectivamente. Após o show, a banda gostou da performance e resolveu continuar junta. Começou a tocar regularmente na churrascaria belo-horizontina Mister Beef, bem como as casas noturnas Janis, Maxaluna e L\'Apogée. A proposta musical era transportar o clima do dancehall jamaicano para a tradição pop brasileira. O primeiro álbum, Skank, foi lançado de forma independente, em 1992. Apesar dos membros nem terem aparelhos de compact disc em casa, fizeram no formato CD, segundo Ferreti, \"para chamar a atenção dos jornalistas, das rádios e talvez de uma gravadora. Era uma aposta na qualidade, na inovação.\" O destaque da banda na cena underground despertou o interesse da gravadora Sony Music que, junto ao Skank, inaugurou no Brasil o selo Chaos e relançou o álbum em abril de 1993.\r\n',0,'',,'Skank',100.00,5,0),(11,2000,'2020-11-01','Nascida em 2014, na cidade de São Paulo, a banda é formada por Eduardo Parras nos vocais, Heros Trench no baixo (produtor do álbum novo), Rafael Agostino nos teclados, os guitarristas Timo Kaarkoski e Thiago de Moura e Rodrigo Oliveira na batera, tem forte apelo no cenário de rock pesado. Donos de muita personalidade, apresentam ao público um estilo Viking Metal, um som único que mescla o Metal e o Folk Music.\r\n\r\nSua trajetória começou em 2014, com seu primeiro álbum, o Power of Warrior, que foi gravado na Dinamarca, com o mesmo produtor do Helloween, Tommy Hansen, e mixado por Peter Tägtgren (Amon Amarth, Children of Bodom e Hypocrisy), tendo sido focado ao público americano, pela Concrete.\r\n\r\nNo início de 2018, lançaram o segundo álbum, o Barbarians in Black, produzido por Kato Khandwala (Pretty Reckless, Papa Roach) e Bruno Agra (We are Harlot), sendo que o primeiro single, e música de trabalho \"Sail Away\", alcançando mais de 100.000 visualizações na primeira semana depois do lançamento. Em fevereiro de 2018, a banda tocou ao lado do Diamond Head e Saxon, numa tour pela Alemanha e Holanda e seu single \"Sail Away\" teve uma produção cinematográfica, ultrapassando mais de 1 milhão de visualizações.\r\n\r\nEm outubro de 2018 também tocou em diversos países da Europa ao lado do Hammerfal e no final do ano, durante os trailers do filme Aquaman exibido em todos os cinemas do Brasil, apresentaram o vídeo da música \"Beware of the Dragon\", que ultrapassou 2,5 milhões de visualizações já que teve contou com uma super produção realizada pela LIBERTÁ FILMS GROUP (Megadeth, Angra, Dee Snider).\r\n\r\nfonte: https://www.facebook.com/pg/ArmoredDawn/about/?ref=page_internal',0,'',,'ARMORED DAWN',400.00,5,0);
